import { NavLink } from 'react-router-dom';
import classes from './EventsNavigation.module.css';

function EventsNavigation() {
  return <header className=''>
    <ul className={classes.list}>
      <li><NavLink end to="/events" className={({ isActive }) => isActive ? classes.active : undefined}>All Events</NavLink></li>
      <li><NavLink to="/events/new" className={({ isActive }) => isActive ? classes.active : undefined}>New Event</NavLink></li>
    </ul>
  </header>
}

export default EventsNavigation;
